import "./App.css";
// import ToDoList from "./components/ToDoList/ToDoList";
import ToDoList from "./components/TodoList1/ToDoList";

import WeatherInfo from "./components/WeatherInfo/WeatherInfo";

function App() {
    return (
        <div className="App">
            <div className="app-content">
                <WeatherInfo />
                <ToDoList />
            </div>
        </div>
    );
}

export default App;
